import { Menu } from "antd";
import {useDispatch} from 'react-redux';

const MenuNavibarLayout = ({ menus }) => {

  const dispatch = useDispatch()
  

  return (
    <Menu mode="horizontal">
      {menus.map((menu) => (
        <Menu.Item>
            <a>{menu}</a>
         
        </Menu.Item>
      ))}
    </Menu>
  );
};

export default MenuNavibarLayout;
